13	Qaval daşı	exhibit/qr_code_13.png	exhibit/az.mp3	exhibit/az.mp3	exhibit/en_iO60xfK.mp3		exhibit/ru.mp3	exhibit/ar.mp3	exhibit/ko.mp4	exhibit/IMG_8034.MOV	exhibit/IMG_8034.MOV						Qobustanda Qaval Daşı: Azərbaycanın Unikal Mədəni İrsi\r\n\r\nBakıdan 60 kilometr cənub-qərbdə yerləşən Qobustan, Azərbaycanın ən mühüm arxeoloji abidələrindən biridir. Bu ərazi 40.000 illik tarixi əhatə edən qayaüstü rəsmləri, palçıq vulkanları və səslənən daşlar kimi unikal təbiət hadisələri ilə məşhurdur. Qobustanın ən diqqətçəkən xüsusiyyətlərindən biri isə Qaval Daşıdır – bu daş, musiqi alətini xatırladan səslər çıxarır və onu həm təbii, həm də mədəni bir möcüzəyə çevirir.\r\n\r\nQaval Daşı Nədir?\r\n\r\nQaval Daşı, vurulduqda dəf və ya tambur səsini xatırladan melodik səslər çıxaran iri əhəngdaşıdır. Bu akustik fenomen daşın unikal quruluşu ilə əlaqəlidir: səthi nazik silisium qatı ilə örtülmüşdür ki, bu da zərbə anında rezonans yaradır. “Qaval” sözü Azərbaycan dilində “dəf” mənasını verir.\r\n\r\nTarixi və Mədəni Əhəmiyyəti\r\n\r\nArxeoloji tədqiqatlar göstərir ki, Qobustanın qədim sakinləri Qaval Daşını ritual və musiqi məqsədləri üçün istifadə ediblər. Bu daşlar, ovçuluq, bayramlar və dini mərasimlərlə əlaqəli olan ayinlərin mərkəzində yer ala bilərdi. Qaval Daşının çıxardığı səslər müqəddəs məna daşıyaraq, ünsiyyət vasitəsi və ya ilahi qüvvələrlə əlaqə qurma yolu olmuş ola bilər.\r\n\r\nMaraqlıdır ki, Qaval Daşı yaxınlığında rəqs edən fiqurların təsvir olunduğu qayaüstü rəsmlər aşkar edilmişdir ki, bu da musiqi və rəqsin qədim Qobustan sakinlərinin həyatında mühüm yer tutduğunu göstərir.	Qobustanda Qaval Daşı: Azərbaycanın Unikal Mədəni İrsi\r\n\r\nBakıdan 60 kilometr cənub-qərbdə yerləşən Qobustan, Azərbaycanın ən mühüm arxeoloji abidələrindən biridir. Bu ərazi 40.000 illik tarixi əhatə edən qayaüstü rəsmləri, palçıq vulkanları və səslənən daşlar kimi unikal təbiət hadisələri ilə məşhurdur. Qobustanın ən diqqətçəkən xüsusiyyətlərindən biri isə Qaval Daşıdır – bu daş, musiqi alətini xatırladan səslər çıxarır və onu həm təbii, həm də mədəni bir möcüzəyə çevirir.\r\n\r\nQaval Daşı Nədir?\r\n\r\nQaval Daşı, vurulduqda dəf və ya tambur səsini xatırladan melodik səslər çıxaran iri əhəngdaşıdır. Bu akustik fenomen daşın unikal quruluşu ilə əlaqəlidir: səthi nazik silisium qatı ilə örtülmüşdür ki, bu da zərbə anında rezonans yaradır. “Qaval” sözü Azərbaycan dilində “dəf” mənasını verir.\r\n\r\nTarixi və Mədəni Əhəmiyyəti\r\n\r\nArxeoloji tədqiqatlar göstərir ki, Qobustanın qədim sakinləri Qaval Daşını ritual və musiqi məqsədləri üçün istifadə ediblər. Bu daşlar, ovçuluq, bayramlar və dini mərasimlərlə əlaqəli olan ayinlərin mərkəzində yer ala bilərdi. Qaval Daşının çıxardığı səslər müqəddəs məna daşıyaraq, ünsiyyət vasitəsi və ya ilahi qüvvələrlə əlaqə qurma yolu olmuş ola bilər.\r\n\r\nMaraqlıdır ki, Qaval Daşı yaxınlığında rəqs edən fiqurların təsvir olunduğu qayaüstü rəsmlər aşkar edilmişdir ki, bu da musiqi və rəqsin qədim Qobustan sakinlərinin həyatında mühüm yer tutduğunu göstərir.	What is Gaval Dash?\r\n\r\nGaval Dash is a massive limestone rock that emits melodious sounds resembling a tambourine or drum when struck. This acoustic phenomenon is due to the stone’s unique structure: its surface is covered with a thin layer of silicon, which creates resonance upon impact. The name “Gaval” derives from the Azerbaijani word for “tambourine.”\r\n\r\nHistorical and Cultural Significance\r\n\r\nArchaeological research suggests that ancient inhabitants of Gobustan used the Gaval Dash for ritualistic and musical purposes. These stones may have played a central role in ceremonies related to hunting, celebrations, and religious rites. The sounds produced by the Gaval Dash likely held sacred meaning, serving as a means of communication or a way to connect with divine forces.\r\n\r\nInterestingly, nearby petroglyphs depict dancing figures, indicating that music and dance were integral to the lives of Gobustan’s ancient residents.\r\n\r\nModern Research and Preservation\r\n\r\nSince 2007, the Gobustan National Historical-Artistic Reserve has been a UNESCO World Heritage site, emphasizing its uniqueness and the need for preservation. Today, the Gaval Dash is a major attraction for tourists, researchers, and musicians from around the world.\r\n\r\nLocal and international scientists continue to study the acoustic properties of the Gaval Dash to better understand the phenomenon of resonant stones. Modern technologies, such as laser scanning and acoustic analysis, help uncover the precise mechanisms of sound production and the unique features of its structure.\r\n\r\nGaval Dash in Art and Popular Culture\r\n\r\nThe musical heritage of the Gaval Dash inspires contemporary Azerbaijani artists to create compositions rooted in ancient motifs. The sounds of this stone are incorporated into various musical works, blending traditional and modern culture. The Gaval Dash has become a symbol of the connection between past and present, illustrating Azerbaijan’s rich cultural legacy.\r\n\r\n\r\nThe Gaval Dash in Gobustan is a unique phenomenon that unites nature, history, and culture. Its existence reminds us of the deep roots of humanity’s musical and artistic traditions. Visiting Gobustan and hearing the Gaval Dash is a journey into Azerbaijan’s ancient history and a chance to experience the magic left by our ancestors.		Гавал даш в Гобустане: Уникальное культурное наследие Азербайджана\r\n\r\nГобустан, расположенный в 60 километрах к юго-западу от Баку, представляет собой один из самых значимых археологических памятников Азербайджана. Эта территория славится своими петроглифами, наскальными рисунками, охватывающими период в 40 000 лет, и уникальными природными явлениями, такими как грязевые вулканы и звуковые камни. Одним из самых выдающихся феноменов Гобустана является гавал даш — камень, обладающий редким свойством издавать звуки, похожие на удары музыкального инструмента, что делает его не только природным, но и культурным феноменом.\r\n\r\nЧто такое гавал даш?\r\n\r\nГавал даш представляет собой массивный известняковый камень, который при ударе издаёт мелодичные звуки, напоминающие звучание бубна или тамбурина. Это звуковое явление объясняется уникальной структурой камня: его поверхность покрыта тонким слоем кремния, который создаёт резонанс при ударах. Название происходит от слова “гавал”, что в азербайджанском языке означает “бубен”.\r\n\r\nИсторическое и культурное значение\r\n\r\nСогласно археологическим исследованиям, гавал даш использовался древними жителями Гобустана в ритуальных и музыкальных целях. Эти камни могли быть частью обрядов, сопровождавших охоту, празднования и религиозные церемонии. Звуки, извлекаемые из гавал даша, вероятно, имели сакральное значение, служили средством коммуникации или инструментом для установления связи с божественными силами.\r\n\r\nОсобенно интересно то, что рядом с гавал дашом были найдены наскальные изображения, на которых изображены танцующие фигуры, что может свидетельствовать о том, что музыка и танец играли важную роль в жизни древних обитателей региона.\r\n\r\nСовременное исследование и сохранение\r\n\r\nГобустанский национальный историко-художественный заповедник с 2007 года включён в список объектов Всемирного наследия ЮНЕСКО. Это признание подчёркивает его уникальность и необходимость охраны. Сегодня гавал даш является одной из ключевых достопримечательностей заповедника, привлекающей туристов, исследователей и музыкантов со всего мира.\r\n\r\nМестные и международные учёные продолжают исследовать акустические свойства гавал даша, чтобы глубже понять феномен звуковых камней. Современные технологии, такие как лазерное сканирование и акустический анализ, помогают определить точные механизмы звукоизвлечения и особенности его структуры.	تاريخ حجر القافال في قوبوستان\r\n\r\nلعب حجر القافال دورًا مهمًا في ثقافة سكان قوبوستان القدماء على مدار آلاف السنين. تشير الأبحاث الأثرية إلى أن هذا الحجر كان يستخدم منذ الألفين السادس والثامن قبل الميلاد. لقد كانت قدرته على إصدار الأصوات موضع تقدير كبير من قبل المجتمعات القديمة، وكان يُستخدم في الطقوس الدينية والمراسم كمصدر بدائي للصوت والموسيقى.\r\n\r\nتم اكتشاف نقوش صخرية بالقرب من حجر القافال تصور شخصيات راقصة، مما يؤكد على أهمية الموسيقى والرقص في الحياة اليومية والمعتقدات لدى الشعوب القديمة. وتُظهر هذه النقوش أن الحجر كان له وظائف دينية واجتماعية على حد سواء.\r\n\r\nمع مرور الوقت، أصبح حجر القافال جزءًا لا يتجزأ من التراث الثقافي لقوبوستان، واليوم يُحافظ عليه باعتباره معلمًا تاريخيًا. وفي عام 2007، أُدرج محمية قوبوستان ضمن قائمة التراث العالمي لليونسكو، مما يؤكد الأهمية الدولية لهذا الحجر كمعلم تاريخي\r\n\r\nتاريخ حجر القافال في قوبوستان\r\n\r\nلعب حجر القافال دورًا مهمًا في ثقافة سكان قوبوستان القدماء على مدار آلاف السنين. تشير الأبحاث الأثرية إلى أن هذا الحجر كان يستخدم منذ الألفين السادس والثامن قبل الميلاد. لقد كانت قدرته على إصدار الأصوات موضع تقدير كبير من قبل المجتمعات القديمة، وكان يُستخدم في الطقوس الدينية والمراسم كمصدر بدائي للصوت والموسيقى.\r\n\r\nتم اكتشاف نقوش صخرية بالقرب من حجر القافال تصور شخصيات راقصة، مما يؤكد على أهمية الموسيقى والرقص في الحياة اليومية والمعتقدات لدى الشعوب القديمة. وتُظهر هذه النقوش أن الحجر كان له وظائف دينية واجتماعية على حد سواء.\r\n\r\nمع مرور الوقت، أصبح حجر القافال جزءًا لا يتجزأ من التراث الثقافي لقوبوستان، واليوم يُحافظ عليه باعتباره معلمًا تاريخيًا. وفي عام 2007، أُدرج محمية قوبوستان ضمن قائمة التراث العالمي لليونسكو، مما يؤكد الأهمية الدولية لهذا الحجر كمعلم تاريخي	고부스탄의 가발 대쉬: 아제르바이잔의 독특한 문화유산\r\n\r\n고부스탄은 바쿠에서 남서쪽으로 60km 떨어진 곳에 위치한 아제르바이잔의 가장 중요한 고고학 유적지 중 하나입니다. 이 지역은 40,000년 이상의 역사를 담고 있는 암각화, 진흙 화산, 그리고 공명석과 같은 독특한 자연 현상으로 유명합니다. 고부스탄의 가장 놀라운 특징 중 하나는 가발 대쉬(Gaval Dash)로, 악기와 유사한 소리를 내는 돌로 자연적이고 문화적인 경이로움을 제공합니다.\r\n\r\n가발 대쉬란 무엇인가요?\r\n가발 대쉬는 두드릴 때 탬버린이나 드럼과 비슷한 선율적인 소리를 내는 거대한 석회암 바위입니다. 이러한 음향 현상은 돌의 독특한 구조 때문으로, 표면이 얇은 실리콘 층으로 덮여 있어 충격 시 공명을 생성합니다. "가발(Gaval)"이라는 이름은 아제르바이잔어로 *"탬버린"*을 뜻합니다.\r\n\r\n역사적 및 문화적 중요성\r\n고고학적 연구에 따르면, 고부스탄의 고대 주민들은 가발 대쉬를 의식적 및 음악적 목적으로 사용했습니다. 이 돌들은 사냥, 축하, 종교 의식과 관련된 의식에서 중심적인 역할을 했을 가능성이 높습니다. 가발 대쉬에서 나오는 소리는 신성한 의미를 지녔으며, 의사소통 수단이나 신과 연결되는 방법으로 사용되었을 것으로 추정됩니다.\r\n\r\n근처 암각화에는 춤추는 인물들이 묘사되어 있어 음악과 춤이 고대 고부스탄 주민들의 삶에서 중요한 부분을 차지했음을 보여줍니다.	1	حجر جافال	Qaval daşı	Gaval Stone	가발스톤	Камень Гаваль	\N	Müasir Tədqiqatlar və Qorunma\r\n\r\n2007-ci ildən etibarən Qobustan Milli Tarix-Bədii Qoruğu UNESCO-nun Dünya İrsi Siyahısına daxil edilib, bu da onun unikallığını və qorunmasının vacibliyini vurğulayır. Bu gün Qaval Daşı turistlərin, tədqiqatçıların və musiqiçilərin böyük maraq göstərdiyi əsas cazibə mərkəzlərindən biridir.\r\n\r\nYerli və beynəlxalq alimlər Qaval Daşının akustik xüsusiyyətlərini öyrənməkdə davam edirlər. Müasir texnologiyalar, məsələn, lazerlə skan etmə və akustik analiz, səs çıxarma mexanizmini və daşın strukturunun unikal xüsusiyyətlərini müəyyən etməyə kömək edir.\r\n\r\nQaval Daşı İncəsənətdə və Populyar Mədəniyyətdə\r\n\r\nQaval Daşının musiqi irsi müasir Azərbaycan sənətçilərini qədim motivlər əsasında bəstələr yaratmağa ilhamlandırır. Bu daşın səsləri müxtəlif musiqi əsərlərinə daxil edilir, ənənəvi və müasir mədəniyyəti birləşdirir. Qaval Daşı keçmişlə bu gün arasında əlaqə simvoluna çevrilərək, Azərbaycanın zəngin mədəni irsini əks etdirir.\r\n\r\nQobustandakı Qaval Daşı təbiəti, tarixi və mədəniyyəti birləşdirən unikal bir fenomendir. Onun mövcudluğu, insanlığın musiqi və incəsənət ənənələrinin nə qədər dərin köklərə malik olduğunu xatırladır. Qobustana səfər edərək Qaval Daşının səsini eşitmək, Azərbaycanın qədim tarixinə toxunmaq və əcdadlarımızın bizə buraxdığı möcüzəni hiss etmək deməkdir.	تاريخ حجر القافال في قوبوستان\r\n\r\nلعب حجر القافال دورًا مهمًا في ثقافة سكان قوبوستان القدماء على مدار آلاف السنين. تشير الأبحاث الأثرية إلى أن هذا الحجر كان يستخدم منذ الألفين السادس والثامن قبل الميلاد. لقد كانت قدرته على إصدار الأصوات موضع تقدير كبير من قبل المجتمعات القديمة، وكان يُستخدم في الطقوس الدينية والمراسم كمصدر بدائي للصوت والموسيقى.\r\n\r\nتم اكتشاف نقوش صخرية بالقرب من حجر القافال تصور شخصيات راقصة، مما يؤكد على أهمية الموسيقى والرقص في الحياة اليومية والمعتقدات لدى الشعوب القديمة. وتُظهر هذه النقوش أن الحجر كان له وظائف دينية واجتماعية على حد سواء.\r\n\r\nمع مرور الوقت، أصبح حجر القافال جزءًا لا يتجزأ من التراث الثقافي لقوبوستان، واليوم يُحافظ عليه باعتباره معلمًا تاريخيًا. وفي عام 2007، أُدرج محمية قوبوستان ضمن قائمة التراث العالمي لليونسكو، مما يؤكد الأهمية الدولية لهذا الحجر كمعلم تاريخي\r\n\r\nتاريخ حجر القافال في قوبوستان\r\n\r\nلعب حجر القافال دورًا مهمًا في ثقافة سكان قوبوستان القدماء على مدار آلاف السنين. تشير الأبحاث الأثرية إلى أن هذا الحجر كان يستخدم منذ الألفين السادس والثامن قبل الميلاد. لقد كانت قدرته على إصدار الأصوات موضع تقدير كبير من قبل المجتمعات القديمة، وكان يُستخدم في الطقوس الدينية والمراسم كمصدر بدائي للصوت والموسيقى.\r\n\r\nتم اكتشاف نقوش صخرية بالقرب من حجر القافال تصور شخصيات راقصة، مما يؤكد على أهمية الموسيقى والرقص في الحياة اليومية والمعتقدات لدى الشعوب القديمة. وتُظهر هذه النقوش أن الحجر كان له وظائف دينية واجتماعية على حد سواء.\r\n\r\nمع مرور الوقت، أصبح حجر القافال جزءًا لا يتجزأ من التراث الثقافي لقوبوستان، واليوم يُحافظ عليه باعتباره معلمًا تاريخيًا. وفي عام 2007، أُدرج محمية قوبوستان ضمن قائمة التراث العالمي لليونسكو، مما يؤكد الأهمية الدولية لهذا الحجر كمعلم تاريخي	Müasir Tədqiqatlar və Qorunma\r\n\r\n2007-ci ildən etibarən Qobustan Milli Tarix-Bədii Qoruğu UNESCO-nun Dünya İrsi Siyahısına daxil edilib, bu da onun unikallığını və qorunmasının vacibliyini vurğulayır. Bu gün Qaval Daşı turistlərin, tədqiqatçıların və musiqiçilərin böyük maraq göstərdiyi əsas cazibə mərkəzlərindən biridir.\r\n\r\nYerli və beynəlxalq alimlər Qaval Daşının akustik xüsusiyyətlərini öyrənməkdə davam edirlər. Müasir texnologiyalar, məsələn, lazerlə skan etmə və akustik analiz, səs çıxarma mexanizmini və daşın strukturunun unikal xüsusiyyətlərini müəyyən etməyə kömək edir.\r\n\r\nQaval Daşı İncəsənətdə və Populyar Mədəniyyətdə\r\n\r\nQaval Daşının musiqi irsi müasir Azərbaycan sənətçilərini qədim motivlər əsasında bəstələr yaratmağa ilhamlandırır. Bu daşın səsləri müxtəlif musiqi əsərlərinə daxil edilir, ənənəvi və müasir mədəniyyəti birləşdirir. Qaval Daşı keçmişlə bu gün arasında əlaqə simvoluna çevrilərək, Azərbaycanın zəngin mədəni irsini əks etdirir.\r\n\r\nQobustandakı Qaval Daşı təbiəti, tarixi və mədəniyyəti birləşdirən unikal bir fenomendir. Onun mövcudluğu, insanlığın musiqi və incəsənət ənənələrinin nə qədər dərin köklərə malik olduğunu xatırladır. Qobustana səfər edərək Qaval Daşının səsini eşitmək, Azərbaycanın qədim tarixinə toxunmaq və əcdadlarımızın bizə buraxdığı möcüzəni hiss etmək deməkdir.	Modern Research and Preservation\r\n\r\nSince 2007, the Gobustan National Historical-Artistic Reserve has been a UNESCO World Heritage site, emphasizing its uniqueness and the need for preservation. Today, the Gaval Dash is a major attraction for tourists, researchers, and musicians from around the world.\r\n\r\nLocal and international scientists continue to study the acoustic properties of the Gaval Dash to better understand the phenomenon of resonant stones. Modern technologies, such as laser scanning and acoustic analysis, help uncover the precise mechanisms of sound production and the unique features of its structure.\r\n\r\nGaval Dash in Art and Popular Culture\r\n\r\nThe musical heritage of the Gaval Dash inspires contemporary Azerbaijani artists to create compositions rooted in ancient motifs. The sounds of this stone are incorporated into various musical works, blending traditional and modern culture. The Gaval Dash has become a symbol of the connection between past and present, illustrating Azerbaijan’s rich cultural legacy.\r\n\r\n\r\nThe Gaval Dash in Gobustan is a unique phenomenon that unites nature, history, and culture. Its existence reminds us of the deep roots of humanity’s musical and artistic traditions. Visiting Gobustan and hearing the Gaval Dash is a journey into Azerbaijan’s ancient history and a chance to experience the magic left by our ancestors.	현대 연구와 보존\r\n2007년 이후 고부스탄 국립 역사-예술 보호구역은 유네스코 세계문화유산으로 등재되어 그 독창성과 보존 필요성을 강조하고 있습니다. 오늘날 가발 대쉬는 전 세계 관광객, 연구자, 음악가들에게 주요한 관광 명소로 자리 잡고 있습니다.\r\n\r\n현지 및 국제 과학자들은 가발 대쉬의 음향 특성을 더 잘 이해하기 위해 연구를 계속하고 있습니다. 레이저 스캐닝과 음향 분석과 같은 현대 기술은 소리 생성 메커니즘과 돌의 독특한 구조적 특징을 밝혀내는 데 도움을 주고 있습니다.\r\n\r\n예술과 대중문화 속의 가발 대쉬\r\n가발 대쉬의 음악적 유산은 현대 아제르바이잔 예술가들에게 고대 모티프를 바탕으로 한 작곡을 영감으로 제공합니다. 이 돌의 소리는 전통과 현대 문화를 융합한 다양한 음악 작품에 통합되고 있습니다. 가발 대쉬는 과거와 현재의 연결을 상징하며, 아제르바이잔의 풍부한 문화 유산을 잘 보여줍니다.\r\n\r\n결론\r\n고부스탄의 가발 대쉬는 자연, 역사, 문화가 어우러진 독특한 현상입니다. 고부스탄을 방문하고 가발 대쉬의 선율적인 소리를 듣는 것은 인류의 예술적, 음악적 뿌리에 대한 여정을 떠나는 것과 같습니다. 우리 조상들이 남긴 이 마법을 경험하는 것은 아제르바이잔의 역사와 정신에 독특한 연결을 제공하는 기회입니다.	Гавал даш в искусстве и популярной культуре\r\n\r\nМузыкальное наследие гавал даша вдохновляет современных азербайджанских артистов на создание композиций, основанных на древних мотивах. Звуки этого камня включаются в различные музыкальные произведения, объединяя традиционную и современную культуру. Гавал даш также стал символом связи между прошлым и настоящим, иллюстрируя богатое культурное наследие Азербайджана.\r\n\r\nГавал даш в Гобустане — это уникальное явление, объединяющее в себе природу, историю и культуру. Его существование напоминает нам о том, насколько глубоки корни музыкальных и художественных традиций человечества. Посетить Гобустан и услышать звучание гавал даша — значит прикоснуться к древней истории Азербайджана и ощутить магию, оставленную предками.\r\n\r\nGaval Dash in Gobustan: A Unique Cultural Heritage of Azerbaijan\r\n\r\nGobustan, located 60 kilometers southwest of Baku, is one of Azerbaijan’s most significant archaeological sites. This region is renowned for its petroglyphs, rock carvings that span over 40,000 years, and unique natural phenomena such as mud volcanoes and resonant stones. One of Gobustan’s most remarkable features is the Gaval Dash — a stone that produces sounds similar to a musical instrument, making it both a natural and cultural wonder.	\N	\N	\N	\N	\N	\N
